description:
Artists of the Pre-Raphaelite Circle: The First Generation

National Museums and Galleries on Merseyside | 1988 | ISBN: 0853315396 | English | 244 pages | PDF | 35.4 MB


The Pre-Raphaelite Brotherhood (later known as the Pre-Raphaelites) was a group of English painters, poets, and critics, founded in 1848 by William Holman Hunt, John Everett Millais and Dante Gabriel Rossetti. The three founders were joined by William Michael Rossetti, James Collinson, Frederic George Stephens and Thomas Woolner to form the seven-member &quot;brotherhood&quot;
